Assume the following two java annotations:

-----------------
ClassA:

/**
 * @model kind="class"
 */
public class ClassA {

}
-----------------
ClassB:

/**
 * @model kind="class"
 */
public class ClassB extends ClassA {

}
-----------------

Feed this as java annotation to EMF model creator, set 'Suppress Interfaces' to 'true' and generate the model. You will get this:

public class ClassA extends EObjectImpl implements EObject
public class ClassB extends EObjectImpl implements EObject

ClassB does not extend ClassA anymore.

