This is being split off from bug 157503.  Basically there needs to be a method which waits for all classpath updates to occur.  Below is the initial implementation:

	public void waitForClasspathUpdate() {
		Job [] jobs = Job.getJobManager().find(J2EEComponentClasspathUpdater.MODULE_UPDATE_JOB_NAME);
		if(jobs.length > 0){
			try {
				for (int i = 0; i < jobs.length; i++){
					if(jobs[i].getName().equals(J2EEComponentClasspathUpdater.MODULE_UPDATE_JOB_NAME))
						jobs[i].join();
				}
			} catch (InterruptedException e) {
				J2EEPlugin.getDefault().getLogger().logError(e);
			}
		}
	}

There are two recommendations to look into for improvements; 1st is to look continuously loop through to make sure another classpath update job has been scheduled, and the second is to wait on the Job family.

