I can reproduce this with a simple SWT snippet.  If an SWT.Close listener ever sets Event.doit to false then no Cmd-Q/App->Quit will no longer work.  The listener is never hit again.  You can still close the app by closing the window, however, and that will never invoke the listener.

import org.eclipse.swt.SWT;
import org.eclipse.swt.events.FocusAdapter;
import org.eclipse.swt.events.FocusEvent;
import org.eclipse.swt.layout.RowLayout;
import org.eclipse.swt.widgets.Button;
import org.eclipse.swt.widgets.Display;
import org.eclipse.swt.widgets.Event;
import org.eclipse.swt.widgets.Listener;
import org.eclipse.swt.widgets.Shell;
import org.eclipse.swt.widgets.Text;

public class BadClosure {

	public static final void main(final String[] args) {
		final Display display = new Display();
		display.addListener(SWT.Close, new Listener() {

			public void handleEvent(Event event) {
				System.out.println("Listener hit");
				event.doit = false;

			}});
		final Shell shell = new Shell(display);

		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch()) display.sleep();
		}
		display.dispose();
	}

}

